def get_gene_url(name):
    """
    args*
    name: gene name to search in the genes_urls dict
    """
    gene_url = genes_urls.get(name)
    return gene_url


def get_gene_seq(index):
    """
    args*
    index: gene index with the maximum similarity to search for its corresponding protein sequnece
    in genes_prot_seq dict

    """
    value_at_index = [str(i) for i in genes_prot_seq.values()][index]
    return value_at_index


def get_gene_name(index):
    """
    args*
    index: gene index with the maximum similarity to search for its corresponding name
    in genes_prot_seq dict

    """
    value_at_index = [str(i) for i in genes_prot_seq.keys()][index]
    return value_at_index


def search_seq(seq):
    """
    args*
    seq: the input protein sequence or translated nucleotide sequence

    -> search the sequence and find the first M and deletes all the characters behind it

    """
    idx = seq.find('M')
    sequence = seq[idx:]
    return sequence


def similar(a, b):
    """
    args*
    a: the entered protein sequence by the user
    b: the protein sequences in the genes_prot_seq dict

    -> takes the two sequences and computes the similarities using hamming distance algorithm

    """
    return textdistance.hamming.normalized_similarity(a, b)


def align_seq(seq1, seq2):
    """
    *args
    seq1 = user input sequence
    seq2 = matched sequence from the data

    -> takes two protein sequences and performs pairwise sequence alignment and plots the alignments
    and scores them using the following values:
    m_score: 2
    mis_score: -1
    gap_open_pen: -0.5
    extend_gap_pen: -0.1

    """

    alignments = pairwise2.align.globalms(seq1, seq2, 2, -1, -0.5, -0.1)

    for a in alignments:
        return format_alignment(*a)


def get_prot_seq(user_input):
    """
    args*
    user_input: the input nucleotide sequence

    -> takes the nucleotide sequence and split it every 3 elements to translate it using
    prot_translation dict then joins them into a string

    """

    prot_list = []
    protein = []
    n = 3

    splited_str = [user_input[index: index + n]
                   for index in range(0, len(user_input), n)]

    for i in splited_str:
        if len(i) != 3:
            continue
        else:
            prot_list.append(''.join(i))

    for i in prot_list:
        for n, c in prot_translation.items():
            if i in c:
                protein.append(n.split('_')[0])

    protein_seq = ''.join(protein).split('*')[0]
    return protein_seq


def search(input_seq):
    """
    args*
    input_seq: the translated nucleotide input sequence

    -> takes the input protein sequence and evaluate its similarity with the genes_prot_seq dict
    and if finds the most similar protein sequence with threshold of 5% similarity/identity

    return: gene_name, gene_type, gene_CDS_ID, gene_seq, gene_url
    """
    similars = []

    for name, seq in genes_prot_seq.items():
        similars.append(similar(input_seq, seq))

    max_similarity = max(similars)
    gene_info = get_gene_name(similars.index(max_similarity))
    gene_seq = get_gene_seq(similars.index(max_similarity))
    gene_name = gene_info.split('_')[0]
    gene_url = get_gene_url(gene_name)
    gene_CDS_ID = gene_info.split('_')[1]
    gene_type = " ".join(gene_info.split('_')[2:])

    if max_similarity == 1.0:
        return gene_name, gene_type, gene_CDS_ID, gene_seq, gene_url
    elif max_similarity < 0.30:
        return gene_name, "not_found", gene_CDS_ID, gene_seq, gene_url
    else:
        return gene_name, 'Mutated and should be {}'.format(gene_type), gene_CDS_ID, gene_seq, gene_url


def func(user_input):
    # New variable
    mut_type = ''
    user_input = str(user_input.translate({ord(c): None for c in string.whitespace})).upper()
    input_set = set(user_input)
    if len(input_set) <= 4:
        first_seq = get_prot_seq(user_input)
        protein_seq = search_seq(first_seq)
    else:
        protein_seq = search_seq(user_input)
    gene_name, gene_type, gene_id, gene_seq, gene_url = search(protein_seq)
    if gene_type == 'not_found':
        return [{
            'error': "Sorry, The Entered Gene May Not Be In Our Database (Similarity Score < 30%)",
            'protein_sequence': protein_seq
        }]
    else:
        prot_alignment = align_seq(protein_seq, gene_seq)
        original_gene = prot_alignment.split('\n')[0]
        lines = prot_alignment.split('\n')[1]
        lines_after = " "
        for index, char in enumerate(lines):
            lines_after += char + " "
        lns = lines_after
        target_gene = prot_alignment.split('\n')[2]
        final_score = prot_alignment.split('\n')[3]
        # New code
        if gene_type[:4] != 'Wild':
            saved_gene = len(gene_seq)
            entered_gene = len(protein_seq)
            if saved_gene == entered_gene:
                mut_type = "Mutation Type is: Substitution Mutation or Invertion Mutation"
            elif saved_gene < entered_gene:
                mut_type = "Mutation Type is: Insertion Mutation or Duplication Mutation Occurred"
            elif saved_gene > entered_gene:
                mut_type = "Mutation Type is: Deletion Mutation Occurred"
        result1 = [{
            'gene_name': "{}".format(gene_name),
            'ccs_id': "{}".format(gene_id),
            'gene_type': "{}".format(gene_type),
            'gene_url': "{}".format(gene_url),
            'max_score': "{}".format(len(gene_seq)*2),
            'match_score': "{}".format(2),
            'mismatch_score': "{}".format(-1),
            'gap_opening_score': "{}".format(-0.5),
            'gap_extension_score': "{}".format(-0.1),
            'original_gene': original_gene,
            'lines': lns,
            'target_gene': target_gene,
            'final_score': final_score

        }]
        result2 = [{
            'gene_name': "{}".format(gene_name),
            'ccs_id': "{}".format(gene_id),
            'gene_type': "{}".format(gene_type),
            'gene_url': "{}".format(gene_url),
            'max_score': "{}".format(len(gene_seq)*2),
            'match_score': "{}".format(2),
            'mismatch_score': "{}".format(-1),
            'gap_opening_score': "{}".format(-0.5),
            'gap_extension_score': "{}".format(-0.1),
            'original_gene': original_gene,
            'lines': lns,
            'target_gene': target_gene,
            'final_score': final_score,
            'Mutation_Type': mut_type,
        }]
        if len(mut_type) > 0:
            return result2
        else:
            return result1
